lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Receive client connection: Client-a580dd0f-b2f9-11ed-8588-080038b54752&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Receive client connection: Client-a580e5e9-b2f9-11ed-8589-080038b54752&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Receive client connection: Client-a5804e6b-b2f9-11ed-9056-080038b53c1c&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Receive client connection: Client-a5805341-b2f9-11ed-9057-080038b53c1c&lt;/p&gt;\n    \n"},"id":"1400","type":"Div"},{"attributes":{"dimensions":"width"},"id":"1022","type":"WheelZoomTool"},{"attributes":{"child":{"id":"1401"},"title":"Summary"},"id":"1402","type":"Panel"},{"attributes":{},"id":"1480","type":"AllLabels"},{"attributes":{},"id":"1504","type":"Selection"},{"attributes":{"child":{"id":"1003"},"title":"Worker Profile (compute)"},"id":"1403","type":"Panel"},{"attributes":{"source":{"id":"1150"}},"id":"1175","type":"CDSView"},{"attributes":{"child":{"id":"1075"},"title":"Worker Profile (administrative)"},"id":"1404","type":"Panel"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n        &lt;h2&gt; Duration: 44.31 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 601 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 56.26 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 97.57 s &lt;/li&gt;\n&lt;li&gt; transfer time: 291.34 ms &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.2.165:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 16 &lt;/li&gt;\n          &lt;li&gt; Threads: 384 &lt;/li&gt;\n          &lt;li&gt; Memory: 2.70 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport yaml\nfrom dask_interface import Initialization\nimport dask\nimport dask.array as da\nfrom dask.distributed import performance_report\nimport time\n\ndef Derivee(F, dx, periodic=0):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n              periodic = 1 if F is periodic\n       Output: dFdx = first derivative of F\n    \"\"\"\n    nx   = len(F)\n    #dFdx = 0. * F\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3:nx - 1] - F[1:nx - 3] - (F[4:nx] - F[0:nx - 4]) / 8.)\n    return dFdx\n\n# Get configuration\nwith open(r'config.yml') as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    Sworkers = data[\"workers\"]\n\n# Scheduler file name \nscheduler_info = 'scheduler.json'\n\n# Initialize the Deisa Adaptor \nAdaptor = Initialization(Sworkers, scheduler_info)\n\n# Check if client version is compatible with scheduler version\nAdaptor.client.get_versions(check=True)\n\n# Get data descriptor as a dict of Dask arrays\narrays = Adaptor.get_data()\n\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n   t = time.time()\n   # Get the Dask array global_t\n   gt = arrays[\"global_t\"]    \n   #gt = gt.rechunk({0: 1})\n   #print(gt.chunks)\n   # Construct a lazy task graph \n   der = Derivee(gt[::2], 1) \n   cpt =  da.linalg.norm(der, axis=(1,2))\n\n   # Submit the task graph to the scheduler\n   s = Adaptor.client.compute(cpt)\n   # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it.  \n   print(s.result(), flush=True)\n\nprint(\"Done in \", time.time() -t, \"secondes\")\nAdaptor.client.shutdown()\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1503","type":"UnionRenderers"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1406","type":"Panel"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"field":"bandwidth","transform":{"id":"1151"}},"hatch_alpha":{"value":0.2},"hatch_color":{"field":"bandwidth","transform":{"id":"1151"}},"height":{"value":1},"line_alpha":{"value":0.2},"line_color":{"field":"bandwidth","transform":{"id":"1151"}},"width":{"value":1},"x":{"field":"source"},"y":{"field":"destination"}},"id":"1173","type":"Rect"},{"attributes":{"base":24,"mantissas":[1,2,4,6,8,12],"max_interval":43200000.0,"min_interval":3600000.0,"num_minor_ticks":0},"id":"1552","type":"AdaptiveTicker"},{"attributes":{},"id":"1288","type":"LinearScale"},{"attributes":{"days":[1,15]},"id":"1556","type":"DaysTicker"},{"attributes":{},"id":"1290","type":"LinearScale"},{"attributes":{},"id":"1435","type":"BasicTickFormatter"},{"attributes":{},"id":"1436","type":"AllLabels"},{"attributes":{"coordinates":null,"group":null,"text":"Bandwidth"},"id":"1283","type":"Title"},{"attributes":{"coordinates":null,"formatter":{"id":"1318"},"group":null,"major_label_policy":{"id":"1319"},"ticker":{"id":"1293"}},"id":"1292","type":"DatetimeAxis"},{"attributes":{},"id":"1438","type":"BasicTickFormatter"},{"attributes":{},"id":"1439","type":"AllLabels"},{"attributes":{"tools":[{"id":"1020"},{"id":"1021"},{"id":"1022
